import React from "react";


function Project() {
  return (
   
      <Turn options={options} className="magazine">
        {pages.map((page, index) => (
          <div key={index} className="page">
            <img src={page} alt="" />
          </div>
        ))}
      </Turn>
   
  );
}

export default Project;
